import rootSaga from "../sagas";
//_app.js는 페이지들의 공통인 부분
const App = ({Component}) => {

    return (
        <>
            <Head>
                <title>BC로</title>
            </Head>
            <Component/>
        </>
    );
}

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
}

export default wrapper.withRedux(App);
